import image18 from "../assets/images/winningPatterns/ZInverse.png";

const GameScoreCarousels = () =>{
   
    const items =[
            {
                id: image1,
                renderItem: (
                    <div  className="item">
                    <img className="myImage" src={image1} alt=""/>
                    </div>
                )
            },
            {
                id: image2,
                renderItem: (
                    <div  className="item">
                    <img className="myImage" src={image2} alt=""/>
                    </div>
                )
            },
            {
                id: image3,
                renderItem: (
                    <div  className="item">
                    <img className="myImage" src={image3} alt=""/>
                    </div>
                )
            },
            {
                id: image4,
                renderItem: (
                    <div  className="item">
                        <img className="myImage" src={image4} alt=""/>
                    </div>
                )
            },
            {
                id: image5,
                renderItem: (
                    <div className="item">
                        <img className="myImage" src={image5} alt=""/>
                    </div>
                )
            },
            {
                id: image6,
                renderItem: (
                    <div className="item">
                        <img className="myImage" src={image6} alt=""/>
                    </div>
                )
            }, 
            {
                id: image7,
                renderItem: (
                    <div className="item">
                        <img className="myImage" src={image7} alt=""/>
                    </div>
                )
            }, 
            {
                id: image8,
                renderItem: (
                    <div className="item">
                        <img className="myImage" src={image8} alt=""/>
                    </div>
                )
            },
            {
                id: image9,
                renderItem: (
                    <div className="item">
                        <img className="myImage" src={image9} alt=""/>
                    </div>
                )
            },
            {
                id: image10,
                renderItem: (
                    <div className="item">
                        <img className="myImage" src={image10} alt=""/>
                    </div>
                )
            },
            {
                id: image11,
                renderItem: (
                    <div className="item">
                        <img className="myImage" src={image11} alt=""/>
                    </div>
                )
            },
            {
                id: image12,
                renderItem: (
                    <div className="item">
                        <img className="myImage" src={image12} alt=""/>
                    </div>
                )
            },
            {
                id: image13,
                renderItem: (
                    <div className="item">
                        <img className="myImage" src={image13} alt=""/>
                    </div>
                )
            },
            {
                id: image14,
                renderItem: (
                    <div className="item">
                        <img className="myImage" src={image14} alt=""/>
                    </div>
                )
            },
            {
                id: image15,
                renderItem: (
                    <div className="item">
                        <img className="myImage" src={image15} alt=""/>
                    </div>
                )
            }, {
                id: image16,
                renderItem: (
                    <div className="item">
                        <img className="myImage" src={image16} alt=""/>
                    </div>
                )
            }, {
                iid: image17,
                renderItem: (
                    <div className="item">
                        <img className="myImage" src={image17} alt=""/>
                    </div>
                )
            },
            {
                id: image18,
                renderItem: (
                    <div className="item">
                        <img className="myImage" src={image18} alt=""/>
                    </div>
                )
            }
        ];

        const { 
            carouselFragment, 
            slideToPrevItem, 
            slideToNextItem 
          } = useSpringCarousel({
            itemsPerSlide: 3, 
            withLoop: true,
            items: items.map((i) => ({
              id: i.id,
              renderItem: (
                <div  className="item">
                    <img className="myImage" src={i.id} alt=""/>
                </div>
              ),
            })),
          });

    return (
    <>
        <div className="winningPatterns">
            <h2 className="h2-title">Winning Patterns and Values</h2>
        </div>
        <div className="carousel">
            <div className="inner-carousel" >
                {carouselFragment}
            </div>
      </div>
    </>
        )
}

export default GameScoreCarousels;
